AWS EC2 connection to MongoDB Atlas failing, could not find user<p>I’m trying to connect to atlas cluster from an ec2, but either if I try by code (nodejs) or by cli, I get this error:</p>
<pre class="lang-bash prettyprint-override"><code>MongoError: Could not find user &quot;arn:aws:sts::***:assumed-role/designspecs-staging-design-Api-1U4X5W-InstanceRole-1TTX7XR8B1D7N/*&quot; for db &quot;$external&quot;
</code></pre>
<p>It is the right role, the problem is that the registered arn on atlas is the one of the role:
arn:aws:iam::***:role/designspecs-staging-design-Api-1U4X5W-InstanceRole-1TTX7XR8B1D7N</p>
<p>And I cannot register the STS one because atlas says it is an invalid arn.</p>
<p>This is the instance role which mongodb should retrieve. If I put in a .env file the keys of a iam user and I make that user a database user for Atlas it works (because the retrieved arn is correct).</p>
<p>Am I missing something? How can I connect the EC2 to atlas without using passwords?</p>
<p>For completeness I should say that I am not assuming any role explicitly, this is the connection code:</p>
<pre class="lang-js prettyprint-override"><code>const remoteDb = `${MONGO_DATABASE_HOST}/${MONGO_DATABASE_NAME}?authSource=%24external&amp;authMechanism=MONGODB-AWS&amp;retryWrites=true&amp;w=majority`;
const localDb = `mongodb://${MONGO_DATABASE_USERNAME}:${MONGO_DATABASE_PASSWORD}@${MONGO_DATABASE_HOST}:27017/${MONGO_INITDB_DATABASE}`;

const mongoURL = process.env.END !== 'dev' ? remoteDb : localDb;

const connect = () =&gt;
    mongoose
        .connect(mongoURL, config)
        .then(() =&gt; {
            console.log('[MongoDB] CONNECTED!');
        })
        .catch(err =&gt; {
            console.error(err);
            console.error(`[MongoDB] ERRROR: NON CONNECTED! -&gt; ${mongoURL}`);
        });

connect();

module.exports = mongoose.connection;
</code></pre>
<p>Where MONGO_DATABASE_HOST is the srv connection string when I am on remote.
All the infrastructure is built with AWS Cloudformation, the role is associated to the instance trough the AWS::IAM::InstanceProfile.</p>

